import React from "react";

const approvalCard = props => {
    return (
        <div className="ui cards">
            <div className="card">
                <div className="content">
                    <img src="" alt="" className="right floated mini ui image" />
                    <div className="header"></div>
                    
                </div>
            </div>
        </div>
    );
};

export default approvalCard;
